import React from 'react'
import { Link } from 'react-router-dom';

function Container({ image, title, explain, links }) {
  return (
    <div className="flex gap-4 md:w-[450px] border-2 border-dark-grey rounded-[15px]">
      <div className="basis-1/2">
        <img src={image} alt="image" />
      </div>
      <div className="basis-1/2 flex-col md:py-3 leading-10">
        <p className="text-green font-bold md:text-[20px]">{title}</p>
        <p>{price}</p>
        <p>{explain}</p>
        <p>{explain}</p>
        <p>{explain}</p>
        <Link to="#" className='hover:text-green'>{links}</Link>
      </div>
    </div>
  );
}

export default Container
